%[text] # Linear Regression in MATLAB
%[text] This Live Script demonstrates how to perform linear regression analysis on sample data, including visualization and statistical evaluation.

%%
%[text] ## Generate Sample Data
%[text] We start by creating synthetic data with a linear relationship plus random noise. The data follows the equation $ y = 2x + 5 + \\text{noise} $.

% Set random seed for reproducibility
rng(42);

% Generate x values from 1 to 50
x = (1:50)';

% Generate y values with linear relationship and noise
% True relationship: y = 2x + 5
y = 2*x + 5 + 10*randn(size(x));

%%
%[text] ## Perform Linear Regression
%[text] Using MATLAB's `polyfit` function, we fit a first-degree polynomial (linear) to the data. The `polyval` function then evaluates this fitted line across all x values.

% Fit a polynomial of degree 1 (linear)
p = polyfit(x, y, 1);

% Evaluate the fitted line
y_fit = polyval(p, x);

%%
%[text] ## Display Regression Results
%[text] The slope (m) and intercept (b) define the fitted line equation $ y = mx + b $.

% Display results
fprintf('Linear Regression Results:\n'); %[output:4db8a666]
fprintf('Slope (m): %.4f\n', p(1)); %[output:065a97cb]
fprintf('Intercept (b): %.4f\n', p(2)); %[output:64f42c85]
fprintf('Equation: y = %.4f*x + %.4f\n', p(1), p(2)); %[output:02973fb3]

%%
%[text] ## Calculate R-squared Value
%[text] The R-squared statistic measures how well the fitted line explains the variance in the data. Values closer to 1 indicate better fit.

% Calculate sum of squared residuals
ss_res = sum((y - y_fit).^2);

% Calculate total sum of squares
ss_tot = sum((y - mean(y)).^2);

% Calculate R-squared
r_squared = 1 - (ss_res / ss_tot);
fprintf('R-squared: %.4f\n', r_squared); %[output:61976dff]

%%
%[text] ## Visualize the Results
%[text] The plot below shows the original data points as blue circles and the fitted regression line in red.

% Create scatter plot of original data
scatter(x, y, 'b', 'filled'); %[output:6a046a95]
hold on; %[output:6a046a95]

% Plot the fitted line
plot(x, y_fit, 'r-', 'LineWidth', 2); %[output:6a046a95]

% Add labels and formatting
xlabel('X'); %[output:6a046a95]
ylabel('Y'); %[output:6a046a95]
title('Linear Regression'); %[output:6a046a95]
legend('Data', 'Fitted Line', 'Location', 'best'); %[output:6a046a95]
grid on; %[output:6a046a95]
hold off; %[output:6a046a95]

